import { Link, Outlet } from "react-router-dom"


import React from 'react'

export const Root = () => {
  return (
    <div>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
            </nav>
            <Outlet />
    </div>
  )
}
